import React from "react";
import { Route } from "react-router-dom";

import "./App.css";

import Homepage from "./pages/Homepage/Homepage";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route>
          <Homepage />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
